Text:
Sombras + Qualidade IG<size:3>{
}<size:29>{
Essa configuração controla o custo da qualidade e performance tanto para sombras não provenientes do sol quanto para a Iluminação Global. O custo para essa configuração é fixo, então quando houver mais ação na tela, ela não ficará mais lenta.
<size:3>{
}
<b>{Baixa (Padrão):} Tanto as Sombras quanto a IG possuem um custo bem baixo com essa configuração.<size:3>{
}
<b>{Alta(Recomendada):} Sombras tem uma boa aparência, mas não custam muito.<size:3>{
}
<b>{Ultra:} Essa configuração é para placas de vídeo bem poderosas. Se a IG estiver ativada, essa configuração terá um custo bem alto.}

Destaca mapas no atlas que correspondem às palavras-chaves especificadas.

Dicas:
<default>{- Digite múltiplas palavras-chaves separando-as com espaços
- Combine textos separados por espaços em uma única palavra-chave usando aspas.
- Pesquise pelo tier do mapa digitando o número do tier
- Busque por mapas únicos digitando <b>{unique}
- Busque por mapas relacionados a Panteões digitando <b>{pantheon}
- Expressões mais usadas são suportadas
- Você pode pressionar <b>{CTRL + F} como atalho}

