Selecione qual gráfico de performance deverá ser mostrado<size:3>{
}<size:29>{
<b>{Nenhum:} Só mostra o número próximo ao gráfico.<size:3>{
}
<b>{Somente o Gráfico Primário:} Mostra apenas o gráfico do modo ativo atualmente.<size:3>{
}
<b>{All Graphs:} Mostra vários fatores limitantes de performance como gráficos adicionais. Estes gráficos tem a mesma cor de suas barras correspondentes. Afeta apenas o modo 'FPS' da UI das Métricas de Performance.}

Mostra vários fatores limitadores de performance como gráficos adicionais. Valores altos indicam fatores que podem ter um impacto negativo na sua experiência de jogabilidade. <size:3>{
}
Só afeta o modo 'FPS' da Ui de Métricas de Performance.

Modo<size:3>{
}<size:29>{
<b>{Janela:} O Jogo abrirá em uma janela com tamanho modificável<size:3>{
}
<b>{Tela Cheia:} Moto tela cheia exclusivo. Outras janelas não podem ser renderizadas em cima dela.}

