Coloque um Mapa não Único na Fornalha dos Sonhos. Transforme itens para adicionar um Modificador Benéfico e outro Prejudicial.

Mate Monstros do Castigo para ganhar Habilidades. Aloque habilidades na Árvore de Habilidades para absorver corrupção mais rápido, destrave Crisóis e Fornalhas dos Sonhos adicionais, assim como resultados adicionais ao transformar seus itens.

<default>{Armas, Secundárias, Armaduras e Acessórios podem ser transformados até 3 vezes, baseado em seu nível de item.}

<default>{Mapas podem ser transformados até 10 vezes.}

<default>{Experiência é recebida ao matar monstros do Castigo.}

